import React, { Component } from "react";

function Fossils() {
  return (
    <div className="App">
        <h1>
          Fossils
        </h1>
      
      <h2>
        Fossil Gallery
      </h2>
    
      <body>
        <img src="/dinos/5.jpg" alt = ""/>
      </body>
      
    </div>
  );
}

export default Fossils;
